import './home.scss';
import CampgroundSmall from './CampgroundSmall';

const Home = () => (
  <main className="home">
    <h1 className="home-title">Bienvenue dans Wildcamp</h1>
    <p className="home-subtitle">Découvrez les derniers spots partagés par la commuanuté Wildcamp :</p>
    <div className="campgrounds-small">
      <CampgroundSmall />
      <CampgroundSmall />
